import item from "../images/item1.avif"

export default function BestSeller(){

    return(
        <div className="best-seller-container">
            <img id="" src={item} alt=""></img>
            <div className="best-seller-description">
                <p id="item-name">Premium Glizzy Hydroflask</p>
                <p id="price">$35</p>
            </div>
        </div>
    )

}
